        paddingTop: '1rem',
    },

}));

function FormPage() {
    const classes = useStyles();

    return (
        <div className={classes.wrapper}> 
         <Header/>
            <Box className={classes.form}>
                <Typography variant='h5' color='primary'>Add Contacts</Typography>   
                <Form/>
            </Box>
            <Footer/>
        </div>
    )
}

